const Mizuki = require('../events');
const { MessageType, MessageOptions, Mimetype } = require('@adiwajshing/baileys');
const axios = require('axios');
const Config = require('../config');
let workt = Config.WORKTYPE == 'public' ? false : true
const list = '♥️ Queen Mizuki N Logo Pack ♥️\n\n|- .summer\nEx:- .summer Mizuki\n\n|- .gsug\nEx:- .gsug I am/Queen/Mizuki\n\n|- .book\nEx:- .book Mizuki\n\n_*Thanks for using Queen Mizuki*_'
const N_DESC = 'Queen Mizuki N logo pack.'
const NEED_WORD = 'කරුණාකර වචනයක් ඇතුළත් කරන්න.'
const PINIMG = 'Gets an Image(Wallpaper) Related to your search'
const GIMG = 'Gets an image from google releted your search and send it'
const PUSAGE = 'Ex :- .pinimg Spider Man'
const GUSAGE = 'Ex :- .gimg Spider Man'

Mizuki.addCommand({ pattern: 'nlogo ?(.*)', fromMe: workt, deleteCommand: false, desc: N_DESC, dontAddCommandList: false }, (async (message, match) => {
     
       await message.client.sendMessage(
        message.jid, list, MessageType.text, {quoted: message.data});    


}));

Mizuki.addCommand({ pattern: 'summer ?(.*)', fromMe: workt,dontAddCommandList: true}, (async (message, match) => {
 
  if (match[1] === '') return await message.client.sendMessage(message.jid,NEED_WORD);
  
  var anime = await axios.get(`https://h4ck3rs404-api.herokuapp.com/api/textmaker/alam?text=${match[1]}&theme=summer&apikey=404Api`, { responseType: 'arraybuffer' })
    
   await message.sendMessage(Buffer.from(anime.data), MessageType.image, {mimetype: Mimetype.jpg, caption: '© ɪ ᴀᴍ Qᴜᴇᴇɴ ᴍɪᴢᴜᴋɪ',quoted: message.data,thumbnail: ""})
    
    
 
}));       

Mizuki.addCommand({pattern: 'gsug ?(.*)', fromMe: workt, dontAddCommandList: true}, (async (message, match) => {

    if (match[1] === '') return await message.client.sendMessage(message.jid,NEED_WORD);
  
  var text, text2, text3;
    if (match[1].includes('/')) {
        var split = match[1].split('/');
       
        text3 = split[2];
        text2 = split[1];
        text = split[0];
}

    var gsugimg = await axios.get(`https://h4ck3rs404-api.herokuapp.com/api/textmaker?text=${text}&text2=${text2}&text3=${text3}&theme=google-suggestion&apikey=404Api`, { responseType: 'arraybuffer' })

    await message.sendMessage(Buffer.from(gsugimg.data), MessageType.image, {mimetype: Mimetype.jpg, caption: '© ɪ ᴀᴍ Qᴜᴇᴇɴ ᴍɪᴢᴜᴋɪ',quoted: message.data,thumbnail: ""})

    }));

Mizuki.addCommand({ pattern: 'book ?(.*)', fromMe: workt,dontAddCommandList: true}, (async (message, match) => {
 
  if (match[1] === '') return await message.client.sendMessage(message.jid,NEED_WORD);
  
  var paper = await axios.get(`https://zenzapi.xyz/api/image/nulis?text=${match[1]}&apikey=b9c9cc1b1385`, { responseType: 'arraybuffer' })
    
   await message.sendMessage(Buffer.from(paper.data), MessageType.image, {mimetype: Mimetype.jpg, caption: '© ɪ ᴀᴍ Qᴜᴇᴇɴ ᴍɪᴢᴜᴋɪ',quoted: message.data,thumbnail: ""})
    
    
 
}));       

